import { Link } from 'react-router-dom'

// styles
import './Navbar.css'

export default function Navbar() {
  return (
    <div className="Navbar">
      <nav>
        <Link to="/" className="home">
          <h1>Cooking Ninja</h1>
        </Link>
      </nav>
    </div>
  )
}
